import React from "react";
// import EastOutlinedIcon from "Arsui/icons-material/Eastout lined";
// import WestOutlinedIcon from "@mui/icons-material/WestOutlined";

const data = [
	"https://images.pexels.com/photos/1549200/pexels-photo-1549200.jpeg?auto=compress&cs=t inys rgb&w=1600",
	"https://images.pexels.com/photos/949670/pexels-photo-949670.jpeg?auto=compress&cs=tinysrgb&w=1600",
	"https://images.pexels.com/photos/837140/pexels-photo-837140.jpeg?auto=compress&cs=tinysrgb&w=1600",
];

const Slider = () => {
	return (
		<div className="slider">
			<div className="container">
				<img src={data[0]} alt="" />
				<img src={data[1]} alt="" />
				<img src={data[2]} alt="" />
			</div>
			<div className="icons">
				<div className="icon">
					<EastOutlinedIcon />
				</div>
				<div className="icon">
					<WestOutlinedIcon />
				</div>
			</div>
		</div>
	);
};

export default Slider;
